import React from 'react';

const HomePage = () => {
    return (
        <div className="homepage">
            <h2>Welcome to the Gym Management System</h2>
            <p>This is the home page. You can navigate to different sections using the menu.</p>
        </div>
    );
};

export default HomePage;
